const AddUser = (props) => {
  return (
    <form>
      <label htmlFor="userName"></label>
      <input type="text" className={styles.input} id="userName"></input>
      <label htmlFor="age"></label>
      <input type="number" id="age"></input>
    </form>
  );
};

export default AddUser;
